import React,{useState} from 'react';
import './App.css'
var QRCode = require('qrcode.react');

const Generate = ()=>{
  const [value,setValue]=useState('');
  
  const handleChange = event=>{
    event.preventDefault();
    setValue(event.target.value)
  }
  return(
    
    <div className="x">
        <div className="form-group">
      <form>
        <label className="text-white">
          <h1>Enter The Info</h1>
          <input className="form-control mr-8 p-2 my-4" id="input-lg" type="text" value={value} onChange={handleChange} />
        </label>
        <input type="submit" value="Submit" />
      </form>
      <QRCode
        id="123456"
        value={value}
        size={290}
        level={"H"}
        includeMargin={true}
      />
      <a onClick={()=>{}}> Download QR </a>
    </div> 
    </div>
  )
}
export default Generate;
